contracts/Message.sol.content:
// SPDX-License-Identifier: MIT

// write pragma version
pragma solidity ^0.8.16;

contract Message {
     string private message = "Hello world!";
     bytes private messageByte = unicode"Hello world!ế";
     bool private gro = true;
     uint private myInt = 1;
     address myAddress;
     address public senderAddress = msg.sender;

     constructor () {myAddress = address(this); }

    function getMyAddress() public view returns (address)  {
      return myAddress;
    }

    function getMyAddressBalance() public view returns (uint)  {
      return myAddress.balance;
    }

    function setMyAddress(address _myAddress) public  {
      myAddress = _myAddress;
    }

    function getGro() pure public returns (bool) {
      return true;
    }

    function getMessageByteLength() public view returns (uint)  {
       return messageByte.length;
    }

    function getMessage() public view returns (string memory) {
      return message;
    }

    // create equalsString function
    function equalsString(string memory alice) public view returns (bool)  {
       return keccak256(abi.encodePacked(message)) == keccak256(abi.encodePacked(alice));
    }


    function setMessage(string calldata _message) public   {
      message = _message;

      gro = !gro;
    }

    function getMyInt() public view returns (uint)  {
       return myInt;
    }

    function setMyInt(uint _myInt) public   {
        require(_myInt < 100);
        myInt = _myInt ;
    }
}

